                <h5 className="card-header">Teacher Registration</h5>
                  <div className="card-body">
                  <form>
  <div className="mb-3">
    <label for="exampleInputEmail1" className="form-label">Full Name</label>
    <input onChange={handelChange} type="text" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp"/>
  </div>
  <div className="mb-3">
    <label for="exampleInputPassword1" className="form-label">Email</label>
    <input onChange={handelChange} type="email" className="form-control" id="exampleInputPassword1"/>
  </div>
  <div className="mb-3">
    <label for="exampleInputPassword1" className="form-label">Password</label>
    <input onChange={handelChange} type="password" className="form-control" id="exampleInputPassword1"/>
  </div>
  <div className="mb-3">
    <label for="exampleInputEmail1" className="form-label">Qualification</label>
    <input onChange={handelChange} type="text" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp"/>
  </div>
  <div className="mb-3">
    <label for="exampleInputEmail1" className="form-label">Mobile Number</label>
    <input onChange={handelChange} type="number" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp"/>
  </div>
  
  <div className="mb-3">
    <label for="exampleInputPassword1" className="form-label">Skills</label>
    <textarea onChange={handelChange} className="form-control"></textarea>
    
  </div>
  
  <button type="submit" className="btn btn-primary">Register</button>
</form>
                  </div>
                </div> 
             </div>
            </div>
        </div>
    );
}
